diff --git a/Objects/abstract.c b/Objects/abstract.c
index f6647874d73..2e7c14c27c8 100644
--- a/Objects/abstract.c
+++ b/Objects/abstract.c
@@ -2232,8 +2232,12 @@ PySequence_Count(PyObject *s, PyObject *o)
  * Use sq_contains if possible, else defer to _PySequence_IterSearch().
  */
 int
-PySequence_Contains(PyObject *seq, PyObject *ob)
+// FIXME: Crash CWE-825: Expired Pointer Dereference
+ PySequence_Contains(PyObject *seq, PyObject *ob)
 {
+    if (seq == NULL) {
+        return 0;
+    }
     PySequenceMethods *sqm = Py_TYPE(seq)->tp_as_sequence;
     if (sqm != NULL && sqm->sq_contains != NULL) {
         int res = (*sqm->sq_contains)(seq, ob);
@@ -2244,6 +2248,7 @@ PySequence_Contains(PyObject *seq, PyObject *ob)
     return Py_SAFE_DOWNCAST(result, Py_ssize_t, int);
 }

+
 /* Backwards compatibility */
 #undef PySequence_In
 int
